import React from "react";

export default class QuestionsList extends React.Component {
    state = {
        loading: true,
        question: null
    }

    async listLoaded() {
        const FETCH_URL = "http://localhost:8080/api/v1/question"

        const response = await fetch(FETCH_URL)

        const data = await response.json()

        console.log(data)

        console.log(data[0])

        this.setState({question: data[0], loading: false})
    }

    render() {
        return(
            <div>
                {this.state.loading || !this.state.question ? <div>loading...</div> : <div><div>test</div></div>}
            </div>
        )
    }
}
